import React from "react";
import {myCss} from "../../../../myCss";

//Material-ui stuff
import withStyles from "@material-ui/core/styles/withStyles";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";

const styles = myCss;

const TopMiniCalendar = (props) => {
    const {classes} = props;
    return (
        <Grid className={classes.calContainer} container>
            <Grid item xs={12}>
                <Typography className="calDisplayW ml-4">M</Typography>
                <Typography className="calDisplayW">T</Typography>
                <Typography className="calDisplayW">W</Typography>
                <Typography className="calDisplayW">T</Typography>
                <Typography className="calDisplayW">F</Typography>
                <Typography className="calDisplayW">S</Typography>
                <Typography className="calDisplayW">S</Typography>
            </Grid>
        </Grid>
    )
}

export default withStyles(styles)(TopMiniCalendar);
